const SkeletonCart = () => {
  return (
    <div className="container">
      <div>
        <div className="box"></div>
        <div className="line"></div>
      </div>
      <style jsx>{`
        .container {
          display: flex;
        }
        .box {
          width: 15rem;
          height: 15rem;
          background-color: #eee;
          margin-right: 2rem;
        }

        .line {
          background-color: #eee;
          height: 3rem;
        }
      `}</style>
    </div>
  );
};

export default SkeletonCart;
